import React from 'react'

const AddUsers =() =>{
    return (
        <form>
            <label htmlFor="username">Username</label>
            <input type="text" name="" id="username" />
            <label htmlFor="age">Age</label>
            <input type="text" name="" id="age" />
        </form>
    )
}

export default AddUsers
